// Home.tsx
import React, {useState, useRef} from 'react';
import About from './About';
import Main from './Main';
import "../css/gravity.css"
import gravity2 from "../img/gravity2.jpg"
import gravity from "../img/gravity.webp"


function Home() {
    const [currentPage, setPage] = useState("");

    const renderPage = () => {
        switch(currentPage){
            case "about":
                return <About />;
            case "main":
                return <Main />;
            default:
               return <>
                    <div>
                        <button onClick={() => setPage("main")}>メイン</button>
                        <Images />
                        <Info />
                    </div>
                </>
        }
    }

    return (
        <>
            {renderPage()}
        </>
    );
}

function Images(){
    return(
        <div className='imgs'>
            <img className="main" src={gravity}></img>
            <img className='main' src={gravity2}></img>
        </div>
    );
}

function Info()
{
    const infoRef = useRef<HTMLParagraphElement>(null);
    return(
        <div className='info'>
            <p ref={infoRef}>jsdklfjalskdfj</p>
            <p ref={infoRef}>fjaslkdajfldks</p>
            <p ref={infoRef}>alksdjfalkfaff</p>
        </div>
    )
}

export default Home;
